SP LT38はバン・小型トラック用タイヤ専用の低燃費ゴムを開発し、大幅に転がり抵抗を低減することで、優れた低燃費性能を実現！従来モデルと比べ、4.3％も燃費向上しています。<br><br>トレッドパターンの接地圧分布を最適化し、最適パターンを採用することで、ライフ性能は従来モデルよりも約12％も長持ちしています。またランド・シー比を最適化し、ウエット性能を向上！摩耗中期以降も新品時のエッジ成分を維持し、ウエット性能の持続を実現しました。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br>タイヤサイズ：185/70R16 (185/70-16)<br><br><br><br>サマータイヤ | 夏タイヤ/16インチ<tr><td colspan="2">
