オンロードでの快適性を重視しながらオフロードの性能も求めるお客様のために、オンロードでの高速操縦安定性やウエット性能と、高いトラクションを発揮するオフロード性能を高次元で両立させました。また、転がり抵抗を約9%削減するとともに、耐偏摩耗性能を向上させることでロングライフを実現するなど、環境性能にも配慮しています<br><br>センター部からミドル部に彫られた「トラクションポケット」、さらに鋭角的な形状を持つ「スクエアショルダープロファイル」と「ショルダーサイプ」がセンター部からショルダー部までまんべんなくしっかり路面に食い込み、オフロードでも強力なトラクション性能を実現します。 フラット形状の「フラット・トレッド・プロファイル」を採用することにより、接地圧が均一でショルダー部までしっかり接地。また、全体的に均一で高い剛性分布パターンにより摩耗が均一に進行し、優れた耐偏摩耗性能を発揮します。　※レイズドブラックレター<br><br>※レイズドブラックレター　※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br>タイヤサイズ：215/70R16 (215/70-16)<br><br><br><br>サマータイヤ | 夏タイヤ/16インチ<tr><td colspan="2">
