車内空間が広いミニバンの音響特性を考え、静粛性に定評のあるレグノに搭載されている先進技術と、新たに中・高音域で耳障りな高周波ノイズを抑制するGRV独自の新技術を採用し、サードシート（後席）までも含めた車内空間の静粛性を向上。<br><br>ミニバンは、コーナーリング時だけでなく、横風、路面の段差やうねり等にも、ふらつきを起こしやすい。その状態をパタン外側の剛性アップで踏ん張るという従来のミニバン専用タイヤに採用されている手法だけでなく、ふらつきの発生を最小限に抑える技術を搭載。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。この商品につきましては配達時間のご指定はできません。<br><br>タイヤサイズ：205/65R16 (205/65-16) <br><br>車検対応品<br><br>サマータイヤ | 夏タイヤ/16インチ<tr><td colspan="2">
