近年の高級車に求められているのは、もはや静粛性ばかりではありません。ハイパワー化が進んだいわゆる高性能ラグジュアリーにおいては、そのパワーに見合う運動性能も同時に求められています。ADVAN　dBはこの潮流を捉え、優れた静粛性を備えながら今のラグジュアリーにふさわしい運動性能と、なめらかでキレの良い乗心地を実現。安心感のある、しなやかな大人の走りを愉しめるタイヤです。<br><br>発売以来、静粛性においてつねに高評価を誇ってきたdB。その性能はまさにヨコハマにおけるひとつの頂点を体現したタイヤです。そして今、高性能化が著しいラグジュアリーカーにふさわしい走行性能を獲得して、静かさの代名詞「dB」は、ADVAN dBへと進化を遂げました。●低燃費タイヤ<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br><br>タイヤサイズ：235/60R16 (235/60-16)<br><br>ADVAN dB V551 235/60R16 100W<tr><td colspan="2">
